import React from 'react';
import { NavLink } from 'react-router-dom';
import  {Jumbotron, Button}  from 'react-bootstrap'
import styles from './HomePage.module.css'

const HomePage = () => {
    return (
    <div styles={styles.homePage}>
        <h1 >
           
            <p>
                I am a techer
            </p>
            <p>
                I am a student
            </p>
            
        </h1>
    </div>
    )
}


export default HomePage
